function displayData(category, data) {
    const container = document.getElementById(`${category}-cards`);
    data.forEach(item => {
        const card = document.createElement("div");
        card.className = "card";
        card.innerHTML = `<h3>${item.name}</h3><img src="${item.image}" alt="${item.name}"><p>${item.details}</p>${item.diameter ? `<p>Diameter: ${item.diameter}</p>` : ''}`;
        container.appendChild(card);
    });
}

displayData('planet', planets);
displayData('comet', comets);
displayData('star', stars);
displayData('asteroid', asteroids);

const rocket = document.getElementById('rocket');
rocket.addEventListener('click', () => {
    rocket.style.transform = 'translate(100vw, -100vh)'; // Move rocket diagonally up and to the right
});
